function hideProjects(){var e;window.matchMedia("(max-width: 768px)").matches&&(e=document.getElementById("catalog-item-container"),document.getElementById("expansible").style.maxHeight=2*e.clientHeight+"px",document.getElementById("expandButton").style.display="inline-block")}function expand(){var e=document.getElementById("expansible");e.classList.toggle("active"),e.style.maxHeight?e.style.maxHeight=null:e.style.maxHeight=e.scrollHeight+"px",document.getElementById("expandButton").style.display="none"}